class OmocResult():#class of its own? Then search must be more elaborate
    CACHED_RESULT=None
    def __init__(self):
        pass
 
    def parseOmocEvents(self,omocJson,calculatedCSS=False,roomSearch=None):
        events=[]
        data = omocJson["data"]
        for entry in data:
            evt = OmocEvent()
            if evt.inRoom(entry,roomSearch):
                evt.parse(entry,calculatedCSS)
                events.append(evt)
        return events
    
class OmocFormatter():
    INTERVAL=4 # 4 hours - ignored! TDB
    def __init__(self):
        self.dayEnd = 1440
    
    def get_time_bounds(self,courses, current_time=None):
        """
        Return start_min, end_min for dynamic schedule,
        rounded to nearest 15 minutes, clipped at current_time.
        """
        if current_time is None:
            current_time = datetime.now().time()
        now_min = current_time.hour * 60 + current_time.minute
    
        if not courses:
            # no courses → schedule starts at current time, round down to 15
            start_min = (now_min // 15) * 15
            end_min = start_min + 60  # show 1 hour by default
            return start_min, end_min
    
        # Courses exist
        min_start = min(c["start"].hour * 60 + c["start"].minute for c in courses)
        max_end = max(c["end"].hour * 60 + c["end"].minute for c in courses)
    
        # Clip start to max(current_time, earliest course)
        start_min = max(min_start, now_min)
        start_min = (start_min // 15) * 15
    
        # Round up end to nearest 15
        end_min = ((max_end + 14) // 15) * 15
    
        # Safety: if no future courses, still show at least 1 hour
        if start_min >= end_min:
            end_min = start_min + 60
            if end_min > self.dayEnd:
                end_min = end_min - self.dayEnd
    
        return start_min, end_min


    def assign_slots(self,courses, current_time=None):
        """Assign slot_index and compute display_start for visual clipping."""
        if current_time is None:
            current_time = datetime.now().time()
        now_min = current_time.hour * 60 + current_time.minute
        block_min = (now_min // 15) * 15
    
        # Group courses by room first
        rooms = {}
        for course in courses:
            room = course.get("room", "Unknown")
            if room not in rooms:
                rooms[room] = []
            rooms[room].append(course)    
    
        # Sort rooms by the earliest start time of their first course
        sorted_rooms = sorted(rooms.items(), key=lambda x: min(c["start"] for c in x[1]))
        
        # Assign slot_index based on room order
        for slot_index, (room, room_courses) in enumerate(sorted_rooms):
            for course in room_courses:
                course["slot_index"] = slot_index
                # Sort courses within each room by start time if needed
                #room_courses.sort(key=lambda c: (c["start"], c["end"]))
                # display_start = max(start, now)
                start_min = course["start"].hour * 60 + course["start"].minute
                end_min = course["end"].hour * 60 + course["end"].minute
                course["display_start"] = max(start_min, block_min)
                course["display_end"] = end_min
    
        room_slots = {}
        for slot_index, (room, room_courses) in enumerate(sorted_rooms):
            tmp = room.split('-')
            hRoom = tmp[-1]
            room_slots[hRoom] = slot_index
    
        return (courses,room_slots)

    #this replaces the css code, which the kiosk can't work with. An example for lightweight css - not used
    def compute_inline_layout(self, courses, day_start_minutes):
        for c in courses:
            # Convert start/end to minutes from midnight
            start_minutes = c["start"].hour * 60 + c["start"].minute
            end_minutes = c["end"].hour * 60 + c["end"].minute
    
            top_px = (start_minutes - day_start_minutes) * 3
            height_px = (end_minutes - start_minutes) * 3
    
            slot = c["slot_index"]  # Assigned earlier in assign_slots
            left_px = slot * 180
    
            bg_color = f"hsl({45 * slot}, 70%, 85%)"
    
            c["top_px"] = top_px + 10
            c["height_px"] = height_px
            c["left_px"] = left_px
            c["bg_color"] = bg_color
    
        return courses


